import './App.css';
import CibilScoreGuide from './components/CibilScoreGuide/CibilScoreGuide';
import CreditInfoSection from './components/CreditInfoSection/CreditInfo';
import CreditJourney from './components/CreditJourney/CreditJourney';
import JoinCredit from './components/JoinCredit/JoinCredit';

function App() {
  return (
    <div className="App">
     <CreditJourney/>
     <br/>
     <JoinCredit/>
     <br/>
     <CreditInfoSection/>
     <br/>
     <CibilScoreGuide/>
    </div>
  );
}

export default App;
